import React from "react";
import "./App.css";
import Card from './Componentes/Card'
import Primera from './Componentes/primera.jpg'
import CardDias from "./Componentes/CardDias";


function App() {
  const imagenes = [
    {
      img: Primera,
      title: "LUNES",
      color: "#00FFFF",
      texto1:
        "Bicicleta",
        texto2:
        "Eliptico",
        texto3:
        "Cinta",
        texto4:
        "Abdominales",
        texto5:
        "Sentadillas",
        texto6:
        "Estocadas"
    }
  ];
  return (
    <div>
      {imagenes.map(card => {
        return (
          <Card
            title={card.title}
            color={card.color}
            img={card.img}
            texto1={card.texto1}
            texto2={card.texto2}
            texto3={card.texto3}
            texto4={card.texto4}
            texto5={card.texto5}
            texto6={card.texto6}
          ></Card>
        ); 
      })}
    </div>

  );
}

export default App;
